const Icard = () =>{
    return(
        <React.Fragment>
            {MenuItem.map((val , index) => {
                //console.log(index)
                return(
                    <Header
                        key={val.id}
                        hname={val.hname}
                        hname={val.hname} 
                    />
                );
            })}
            <h1 className="heading_style">Download Free Web series from moviesmazaonline</h1>
            <div className="card-wrapper">
                {Sdata.map((val , index) => {
                    console.log(index)
                    return(
                        <Card
                            key={val.id}
                            imgsrc={val.imgsrc}
                            title={val.title} 
                            sname={val.sname}     
                            links={val.links} 
                        />
                    );
                })}
            </div>
        </React.Fragment>

    // <React.Fragment>
    //     <Menu />
    //     <h1 className="heading_style">List of top 10 webseries in 2020</h1>
    //     <div className="card-wrapper">
    //         {/* <Favs /> */}
    //         {(Favseries ==="Netflix") ? <Netflix /> :  <Amazon />}
    //     </div>

    // </React.Fragment>
    )
}
export default Icard;
